import React from 'react';
import ReactDOM from 'react-dom';
import './index.css';
import App from './App';
import { UserProvider } from "./context/UserContext"


import { HashRouter, Routes, Route } from 'react-router-dom';




ReactDOM.render(

  <React.StrictMode>
    <HashRouter>
      <UserProvider>
        <App />
      </UserProvider>
    </HashRouter>
  </React.StrictMode>,
  document.getElementById('root')
);

